import React from 'react';
import { Row, Col, Card } from 'react-bootstrap';
import { Gear } from 'react-bootstrap-icons';

function SummaryItem({ label, value }) {
  return (
    <div>
      <small className="text-muted">{label}</small>
      <p className="mb-0">{value}</p>
    </div>
  );
}

function SummarySection() {
  return (
    <Card className="mt-3 mb-4">
      <Card.Body>
        <Row className="align-items-center">
          <Col xs={12} sm={2}>
            <SummaryItem label="Date of birth" value="1975-01-01" />
          </Col>
          <Col xs={12} sm={2}>
            <SummaryItem label="SSN" value="192213322122" />
          </Col>
          <Col xs={12} sm={2}>
            <SummaryItem label="Companies" value="4" />
          </Col>
          <Col xs={12} sm={2}>
            <SummaryItem label="ID Control" value="Partial match on name and date of birth" />
          </Col>
          <Col xs={12} sm={2}>
            <SummaryItem label="Screening" value="Sanction + SIP found" />
          </Col>
          <Col xs={12} sm={1}>
            <SummaryItem label="Screening monitor" value="Active" />
          </Col>
          <Col xs={12} sm={1} className="text-end">
            <Gear size={20} className="text-muted" style={{ cursor: 'pointer' }} />
          </Col>
        </Row>
      </Card.Body>
    </Card>
  );
}

export default SummarySection;
